INSERT INTO `fx_content_blogpost` (`id`, `anounce`, `text`, `publish_date`, `metatype`) VALUES
(94, 'Эритрея удивительная страна! Наверное, это лучшая африканская страна, где я был. В Эритрее нет ничего плохого. Здесь нет денег, нет интернета, нет СМИ, нет телефонов, нет машин, нет продуктов в магазинах, нет ничего, что приносит в нашу жизнь кучу проблем. Я еще нигде не встречал таких добрых и открытых людей, еще нигде я не видел таких уютных и красивых улиц, еще нигде мне не было так хорошо.', 'Эритрея удивительная страна! Наверное, это лучшая африканская страна, где я был. В Эритрее нет ничего плохого. Здесь нет денег, нет интернета, нет СМИ, нет телефонов, нет машин, нет продуктов в магазинах, нет ничего, что приносит в нашу жизнь кучу проблем. Я еще нигде не встречал таких добрых и открытых людей, еще нигде я не видел таких уютных и красивых улиц, еще нигде мне не было так хорошо. К сожалению, пока я не могу вам показать всю это красоту. Я сижу в лобби своего отельчка и пытаюсь загрузить почту. На загрузку письма уходит минут 10, сайты вообще не открываются . Нормального интернета в стране нет. "Сэр, вы должны быть очень терпеливы, если хотите использовать интернет!" - предупреждает меня менеджер отеля. И он прав. Полвека Эритрея была итальянской колонией. Италия подарила стране отличную архитектуру и научила пить кофе. Кофейни тут на каждом шагу, причем в каждой тебе сделают великолепный итальянский эспрессо! Чашечка кофе стоит всего 5 рублей. Меньше всего Эритрея похожа на Африку. Это скорее Куба. Удивительно, но здесь удалось сохранить чудную колониальную архитектуру нисколько не испортив ее. Тут до сих пор стоит старая мебель в аптеках и антикварные итальянские кассовые аппараты. Здесь кино показывают в старых итальянских кинотеатрах. Правда электричества нет, так что приходится во время каждого сеанса заводить генератор. Конечно, есть и другая сторона медали. Эритрея - одна из беднейших стран мира. Власть тут узурпировал кровавый режим. Действующий президент 15 лет назад отменил президентские выборы, а в 2001 году он запретил национальную прессу. Гражданам страны запрещено выезжать за границу, если там нет родственников. Хотя, даже если очень захочется, выехать не получится - в стране нельзя купить доллары. Просвещенная Европа, конечно, попыталась спасти бедных эритрейцев и запретила эритрейским лидерам въезд в страны-члены ООН, а их счета в иностранных банках заморозили. Так, кровавый режим оказался в одной лодке со своим народом. Но тут никто особо не расстроился. Эритрея настолько прекрасная страна, что уезжать отсюда никуда не хочется. Про Эритрею будет очень интересные посты. Я просто в восторге от этого места. Осталось выбраться отсюда на большую землю, к нормальному интернету!', '2013-03-01 00:00:00', NULL),
(97, 'До 2 апреля мы проводим набор кандидатов на стажировку для менеджеров в апреле и мае 2013 года. Для получения задания необходимо отправить письмо с фотографией и кратким рассказом о себе на адрес: internship@artlebedev.ru.  ', 'До 1 апреля мы проводим набор кандидатов на стажировку для менеджеров в апреле и мае 2013 года. Для получения задания необходимо отправить письмо с фотографией и кратким рассказом о себе на адрес: internship@artlebedev.ru.  ', '2013-02-25 00:00:00', NULL),
