(1926, '<p>\n	Во время поездки в Гвинею аборигенами был съеден <img src="/floxim_files/content/arrow02_5.png"> Иван Семенович Курочкин, наш бессменный второй оператор. Выражаем соболезнования семье Ивана.</p>', '<p>\r\n	 Павел был отличным профессионалом и чутким, добрым человеком. Почему аборигены не разглядели в нем этих качеств - для нас остается загадкой.\r\n</p>', '2013-05-14 00:00:00', NULL),
(1968, '<p class="">\n	    Бедный, несчастный Курочкин, съеденный <span data-redactor="verified" style="color: rgb(75, 172, 198); ">очень злыми аборигенами</span> Гвинеи, не будет похоронен.</p><p>\n	  Оло <img src="http://jeeptravel.loc/floxim_files/content/arrow02_4.png">  чывочо.</p>', '<p>\r\n	Как легко догадаться, хоронить-то особо нечего, поскольку покойник остался в желудках диких папуасов весь, целиком.\r\n</p>', '2013-06-11 00:00:00', NULL),
(1976, '<p>\n	 Dubr is on air!</p><p>\n	 <img src="http://www.blogovo.ru/i/ava.gif"></p><p>\n	 Hello :)</p>', 'Это полный еткст поста  ', '2012-04-19 00:00:00', NULL),
(1996, '<p>\r\n	        Horray! Gloria! It''s our birthday now ;)\r\n</p>', '<p class="">\r\n	             Пьем вкусную выпивку и празднуем изо всех сил.\r\n</p>\r\n<p>\r\n	             Присоединяйтесь, друзья!\r\n</p>', '2013-07-03 00:00:00', 'article');
